import React from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import styles from './App.module.css';
import StyleCard from './components/StyleCard';
import ClothingCatalog from './components/ClothingCatalog';
import { BsCart3, BsBell } from 'react-icons/bs';
import { IoArrowBack } from 'react-icons/io5';

const styleCategories = [
  {
    id: 1,
    name: 'Casual',
    image: '/images/casual-style.jpg',
    link: '/catalog/casual'
  },
  {
    id: 2,
    name: 'Trendy',
    image: '/images/trendy-style.jpg',
    link: '/catalog/trendy'
  },
  {
    id: 3,
    name: 'Polo Style',
    image: '/images/polo-style.jpg',
    link: '/catalog/polo'
  },
  {
    id: 4,
    name: 'Sunny look',
    image: '/images/sunny-style.jpg',
    link: '/catalog/sunny'
  }
];

const Collections = () => {
  const navigate = useNavigate();

  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <button className={styles.backButton}>
          <IoArrowBack size={24} />
        </button>
        <h1 className={styles.title}>Collections</h1>
        <div className={styles.headerIcons}>
          <button className={styles.iconButton}>
            <BsCart3 size={20} />
          </button>
          <button className={styles.iconButton}>
            <BsBell size={20} />
          </button>
        </div>
      </header>

      <nav className={styles.navigation}>
        <button className={`${styles.navButton} ${styles.active}`}>YOURS</button>
        <button className={styles.navButton}>TRENDING</button>
        <button className={styles.navButton}>ALL COLLECTIONS</button>
      </nav>

      <div className={styles.startCustomize}>
        Start Customise
      </div>

      <div className={styles.grid}>
        {styleCategories.map(category => (
          <div key={category.id} onClick={() => navigate(category.link)}>
            <StyleCard
              name={category.name}
              image={category.image}
            />
          </div>
        ))}
      </div>

      <button className={styles.addButton}>
        <span>+</span>
      </button>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Collections />} />
        <Route path="/catalog/:style" element={<ClothingCatalog />} />
      </Routes>
    </Router>
  );
}

export default App;
